        var uploadedPhotos = [];
        response.forEach((function (photo) {
          uploadedPhotos.push(ContentPhoto['default'].create(photo));
        }).bind(this));

        photoModels.pushObjects(uploadedPhotos);
        this.set("landingPagePhotos", photoModels);
